import react from 'react';

const Main = () => {
    return (
        <main className='active'>
          <Routes>
            <Route exact path='/calculator' element={ <Calculator /> } />
            <Route exact path='/rates' element={ <Rates /> } />
            <Route exact path='/loading' element={ <Loading /> } />
          </Routes>
        </main>
    )
}

export default Main;
